import React from 'react'
import ReactDOM from 'react-dom';
import './index.css'

class Square extends React.Component {
   render(){
      return(
         <div>
            <a className='fb' href='#'></a>
         </div>
      )
   }
}



ReactDOM.render(<Square />, document.getElementById('root'));
